        "content": "[CONTEXT: Header 1: Deleting Events From Fiddler]\n\n# Deleting Events From Fiddler  \nFiddler enables you to delete previously published production inference data using either unique identifiers or event timestamps using our Events [REST API](../../api_guidelines/events.md).  \n> **Note:**\n>\n> Event deletion is only offered using the REST API and is not currently supported in the Fiddler Python client.  \nCommon reasons for deletion include:  \n* Complying with data privacy regulations ([GDPR](https://commission.europa.eu/law/law-topic/data-protection/legal-framework-eu-data-protection_en), [CCPA](https://www.oag.ca.gov/privacy/ccpa), etc.)\n* Removing erroneously published data\n* Correcting data inaccuracies  \n## Impact on Monitoring Metrics  \nWhen deleting inference data with the time range filter you can control how it affects your monitoring metrics using the `update_metrics` parameter in the Events Delete REST API:  \n* Preserve existing aggregated metrics: `update_metrics=True`\n* Recalculate metrics to reflect the data removal (default): `update_metrics=False`  \n## Important Considerations  \n* Deletions are permanent and cannot be undone\n* Pre-production (baseline) datasets do not support row-level deletion\n* Large-scale deletions may temporarily impact data ingestion performance during metric recalculation  \n## Deletion Methods  \nFiddler supports two filtering methods for deletion (only one method can be used per API call):  \n### Delete by Event ID  \nDelete specific inference events by providing their unique identifiers. The event ID corresponds to the `event_id_col` specified during [Model](../../api-methods-30.md#model) onboarding. This method removes all events matching the provided IDs, including duplicates.  \n### Delete by Timestamp Range  \nDelete events within a specified time period using start and end timestamps. The timestamp used for filtering corresponds to the event\\_ts\\_col specified during [Model](../../api-methods-30.md#model) onboarding.  \n**Usage params**  \n| Parameter       | Type            | Default | Description                                                                                                                                         |\n| --------------- | --------------- | ------- | --------------------------------------------------------------------------------------------------------------------------------------------------- |\n| model\\_id       | UUID            | -       | Unique identifier for the model from which production events are deleted.                                                                           |\n| time\\_range     | Optional\\[dict] | -       | Dictionary with `start_time`(inclusive) and `end_time`(exclusive), (i.e. `start_time` \u2264 t < `end_time`), format of timestamp: 'YYYY-MM-DD HH:mm:ss' |\n| event\\_ids      | Optional\\[list] | -       | List of event\\_ids to be deleted.                                                                                                                   |"
    },
