        "content": "[CONTEXT: Header 1: Python Client API Reference]\n\n# With version\nmodel = fdl.Model.from_data(\nsource=<file_path>,\nname=MODEL_NAME,\nversion='v2',\nproject_id=PROJECT_ID,\nspec=fdl.ModelSpec(**MODEL_SPEC),\n)\n```  \n**Returns**  \n| Return Type                      | Description     |\n| -------------------------------- | --------------- |\n| [Model](api-methods-30.md#model) | Model instance. |  \n**Notes**  \n* > `from_data` will not create a model entry on Fiddler Platform.\\\n> Instead this method only returns a model instance which can be edited, call `.create()` to onboard the model to\\\n> Fiddler Platform.\n* > `spec` is optional to `from_data` method. However, a `spec` with at least `inputs` is required for model onboarding.\n* > Make sure `spec` is passed to `from_data` method if model requires custom features. This method generates centroids\\\n> which are needed for custom feature drift computation\n* > If `version` is not explicitly passed, Fiddler Platform will treat it as `v1` version of the model.  \n#### create()  \nOnboard a new model to Fiddler Platform  \n**Parameters**  \nNo  \n**Usage**  \n```python\nmodel = fdl.Model.from_data(...)\nmodel.create()\n```  \n**Returns**  \n| Return Type                      | Description     |\n| -------------------------------- | --------------- |\n| [Model](api-methods-30.md#model) | Model instance. |  \n**Raises**  \n| Error code | Issue                                       |\n| ---------- | ------------------------------------------- |\n| Conflict   | Model with same name may exist in project . |  \n#### get()  \nGet model from Fiddler Platform based on UUID.  \n**Parameters**  \n| Parameter | Type        | Default | Description                      |\n| --------- | ----------- | ------- | -------------------------------- |\n| id_      | UUID \\| str | -       | Unique identifier for the model. |  \n**Returns**  \n| Return Type                      | Description     |\n| -------------------------------- | --------------- |\n| [Model](api-methods-30.md#model) | Model instance. |  \n**Raises**  \n| Error code | Issue                                                          |\n| ---------- | -------------------------------------------------------------- |\n| NotFound   | Model with given identifier not found.                         |\n| Forbidden  | Current user may not have permission to view details of model. |  \n**Usage**  \n```python\nMODEL_ID = '4531bfd9-2ca2-4a7b-bb5a-136c8da09ca2'\nmodel = fdl.Model.get(id_=MODEL_ID)\n```  \n#### from_name()  \nGet model from Fiddler Platform based on name and project UUID.  \n**Parameters**  \n| Parameter   | Type           | Default | Description                        |\n| ----------- | -------------- | ------- | ---------------------------------- |\n| name        | str            | -       | Name of the model.                 |\n| project_id | UUID \\| str    | -       | Unique identifier for the project. |\n| version     | Optional\\[str] | -       | Unique version name within a model |  \n> `version` parameter is available from `fiddler-client==3.1` onwards"
    },
    "Document 3": {
        "metadata": {},
        "content": "5. High-risk AI systems shall be resilient against attempts byunauthorized third parties to alter their use, outputs or performance by exploiting system vulnerabilities.  \nArticle 72: Post-Market Monitoring by Providers and Post-Market Monitoring Plan for High-Risk AI Systems  \n1. Providers shallestablishand document apost-market monitoring systemin a manner that is proportionate to the nature of the AI technologies and the risks of the high-risk AI system.  \nPredictive models are unique software entities, as compared to traditional code, in that they are probabilistic in nature. They are trained for high performance on repeatable tasks using historical examples. As a result, their performance can fluctuate and degrade over time due to changes in the model input after deployment. Depending on the impact of a high risk AI application, a shift in its predictive power could have a significant consequence on the use case, e.g. an ML model for recruiting that was trained on a high percentage of employed candidates will degrade if the real-world data starts to contain a high percentage of unemployed candidates, say in the aftermath of a recession. It can also lead to the model making biased decisions.  \nMonitoring these systems in a single pane of glass enables continuous operational visibility to ensure their behavior does not drift from the intention of the model developers and cause unintended consequences.  \nGenerative AI models and applications can also be impacted by data drift, causing responses to vary over time for the same prompt. There are additional risks around safety, correctness, and privacy, as a result of hallucinations, jailbreak attempts or PII leakage.  \nFiddler\u2019sLLM ObservabilityandML Observabilityhelps address all AI risks, including visibility, degradation, and other operational challenges for deployed models, ensuring AI compliance after the EU AI Act changes. The FiddlerAI Observabilityplatform enables deployment teams to monitor model behavior, prevent drift, and mitigate unintended consequences, with alerting options to promptly address immediate operational issues.  \nArticle 12: Record-Keeping  \n1. High-risk AI systems shall technically allow for theautomatic recording of events(logs) over the lifetime of the system.  \n2. In order to ensure a level of traceability of the functioning of a high-risk AI system that is appropriate to the intended purpose of the system, logging capabilities shall enable the recording of events relevant for:  \n...  \n(b) facilitating the post-market monitoring"
    },
    "Document 4": {
        "metadata": {},
        "content": "DOC_URL:https://docs.fiddler.ai/product-guide/analytics/README\nDOC_CONTENT:---\nslug: analytics-ui\nicon:\ndescription: >-\nExplore our UI guide to Fiddler analytics. Learn about interfaces for various analytics charts and root cause analysis to better understand your models.\nhidden: false\nlayout:\ntitle:\nvisible: true\ndescription:\nvisible: false\ntableOfContents:\nvisible: true\noutline:\nvisible: true\npagination:\nvisible: true\n---  \n## Interfaces  \n### Analytics Charts  \nThere are three supported analytics chart types:  \n1. _**Performance Analytics**_ \u2014 Visualize various performance metrics tailored to different task types, such as confusion matrices, prediction scatterplots, and more.\n2. _**Feature Analytics**_ \u2014 Analyze the behavior and relationships between features, helping to identify patterns and insights within the data, using feature distribution, feature correlation, and correlation matrix charts.\n3. _**Metric Card**_ \u2014 Display a single numeric representation of a metric, offering a concise overview of performance, data quality, data integrity, or custom metrics on a card.  \n### Root Cause Analysis  \nThe Root Cause Analysis (RCA) experience consists of four parts, all based on the FQL segment and time range provided in the monitoring chart:  \n1. _**Events**_ \u2014 Browse a sample of 1,000 events.\n2. _**Data Drift**_ \u2014 View a breakdown of drift for your features, along with prediction drift impact.\n3. _**Data Integrity**_ \u2014 Review a summary of data integrity violations, including counts across range, type, and missing value issues.\n4. _**Analyze**_ \u2014 View performance and feature analytics charts.  \n![Root Cause Analyze Experience](../../.gitbook/assets/root-cause-analysis-analyze.png)  \n{% include \"../../.gitbook/includes/main-doc-footer.md\" %}"
    },
